s[4]="Parallettes Warm-Up for Overhead Squat \n(Create a mini routine by going through the list. Omit the more difficult variations until skilled enough.) \n* Push-up/dive bomber push-up \n* Shoot-through to push-up to frog stand \n* L-sit pass-through to tuck planche \n* L-sit pass-through to shoulder stand \n* Tuck up to handstand/press to handstand (from L or press from bottom of shoulder stand) \n* Handstand pirouette walk \n* Handstand holds with focus on overhead stability and shoulder activation (hold for 15-30 seconds) \n* Handstand push-up with a narrow grip (to target shoulder and triceps strength, which are important for overhead squat stability) \n* Handstand shoulder shrugs (to improve shoulder stability and scapular control)"
